import React, { Component } from "react";
import TopBar from "../Menu/MenuPage/TopBar";
import Typography from "@material-ui/core/Typography";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

class OrderConfirmationPage extends Component {
  render() {
    return (
      <div style={{ backgroundColor: "#FFCCCB" }}>
        <TopBar />
        <div style={{ padding: "2%" }}>
          <Typography component="h2" style={{ fontSize: 20 }}>
            First Name
          </Typography>
          <TextField variant="outlined" style={{ paddingBottom: 10 }} />
          <Typography component="h2" style={{ fontSize: 20 }}>
            Last Name
          </Typography>
          <TextField variant="outlined" style={{ paddingBottom: 10 }} />
          <Typography component="h2" style={{ fontSize: 20 }}>
            Phone Number
          </Typography>
          <TextField variant="outlined" />
        </div>
        <div style={{ padding: "2%" }}>
          <Button
            fullWidth
            variant="contained"
            onClick={this.handleOpenDialog}
            style={{
              padding: "2%",
              fontSize: 20,
              color: "white",
              backgroundColor: "green",
            }}
          >
            Confirm Order
          </Button>
        </div>
      </div>
    );
  }
}

export default OrderConfirmationPage;
